import React from "react";
import {Nav} from "react-bootstrap";
import { withRouter } from "react-router";
import logo from '../logo.svg'
import logout from '../logout.svg'
import {Link} from 'react-router-dom'
import "./Sidebar.css";

const Side = props => {
   

    return (
        <>
    
            <Nav className="col-md-12 d-none d-md-block bg-light sidebar"
            activeKey="/home"
            onSelect={selectedKey => alert(`selected ${selectedKey}`)}
            >
                <div className="sidebar-sticky"><Link to="/patient"> <img className= "navbar-icon" src={logo} alt="icon"/></Link></div>
            <Nav.Item>
                <Nav.Link href="/home">Dashboard</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1">Schedule</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-2">Patient</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-3">Generics</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Link to ="/doctor" className="nav-link"><img src={logout} width="15" height="25"className="d-inline-block align-top"/></Link>
            </Nav.Item>
            </Nav>
          
        </>
        );
  };
  const Sidebar = withRouter(Side);
  export default Sidebar
